(125, '2019-09-21 13:24:57', '2019-09-21 13:24:57', NULL, 'Преступный интернационал в центре Европы. Как NATO создают государства-бандиты', 'Эта книга о том, как устроен современный мир, как мировая верхушка, низовым и внелегальным сегментом которой являются операторы мировой криминальной системы (связь обеспечивают спецслужбы и некоторые семьи нижней и средней частей мировых верхов), управляет историческим процессом. На примере частично признанного государства — Республики Косово — вскрыта природа государства-бандита, убедительно показано, как неразрывно связаны политико-экономические интересы и цели западных политиков, военных, банкиров, руководителей СМИ и албанских криминальных структур, как совместно они пытаются перекраивать не только современный мир — его экономику и географию, но и историю', 84, '', 1, 1),
(126, '2019-09-21 13:24:57', '2019-09-21 13:24:57', NULL, 'Мировые войны и мировые элиты', 'Парады на Красной площади 9 мая и патриотические фильмы напоминают нам о героических сражениях Великой Отечественной, но не раскрывают тех тайных механизмов, которые раскрутили кровавый маховик Второй мировой войны. Для большинства современных людей фашизм это Бенито Муссолини и Адольф Гитлер. Однако концлагеря были придуманы не Гитлером, не Муссолини и не Гиммлером. Заключенные в полосатых робах выпускали шоколад Nestle, моторы BMW и автомобили Volkswagen. Освенцим был лишь «частной инициативой» корпорации I.G. Farbenindustrie AG, где учет заключенных велся счетными машинами IBM, а медицинские опыты над людьми проводились по заказу фи Настоящими «фюрерами» фашизма были корпорации, основавшие Третий рейх. В нацистской Германии впервые появились и телевизионная реклама, и термин «приватизация». Именно приватизация всего и вся частными банками стала основной целью плана «Ост» на оккупированных территориях Восточной Европы. А разработчиком планов Третьего рейха по завоеванию мирового господства был картель международных корпораций, объединенных в концерн I.G. Farbenindustrie AG. Планы этих господ, руководящих банками и монополиями, не изменились и по сей день. Как заметил американский комик Джордж Карлин, «Германия потерпела поражение во Второй мировой войне, а фашизм победил. Поверьте мне, мой друг…» e-reading.club', 85, '0ca0207f66f030c93882d92adf0791f6.zip', 1, 1),
(127, '2019-09-21 13:24:57', '2019-10-05 13:10:28', NULL, 'Лестница в небо', 'В своей книге Хазин и Щеглов предлагают читателю совершенно новую трактовку сущности Власти, подробно рассказывая о всех стадиях властной карьеры — от рядового сотрудника корпорации до высокопоставленного представителя мировой элиты.\r\nКакое правило Власти нарушил Стив Джобс, в 1984 году уволенный со всех постов в собственной компании Apple? Какой враг довел до расстрела «гения Карпат», всесильного диктатора Румынии Николае Чауше- ску? Почему военный переворот 1958 года во Франции начали генералы, а власть в результате досталась давно вышедшему в отставку Де Голлю? Сколько лет потребовалось настоящему человеку Власти, чтобы пройти путь от нищего на паперти до императора Византии, и как ему вообще это удалось?\r\nОб этом и о многом другом — в новой книге известного российского экономиста Михаила Хазина и популярного блогера Сергея Щеглова.', 86, 'bfa919e5359cf3ed8b1d71ee53934506.zip', 1, 1);
